"use strict";angular.module("sbAdminApp").controller("allCtrl",function($scope,$position,$location,$http){$http.get("api/count/shortcode").then(function(response){$scope.codeCount=response.data.data},function(response){$scope.alerts=[{msg:response.data.userMessage||"Server error! Are you connected to the internet?.",type:"error"}]}),$scope.search=function(){$http.get("api/alldata/"+$scope.searchCode).then(function(response){$scope.result=!0,$scope.unprocessed=response.data.data.unprocessed,$scope.blacklisted=response.data.data.blacklisted,$scope.regex=response.data.data.regex,$scope.handled=response.data.data.handled},function(response){$scope.alerts=[{msg:response.data.userMessage||"Server error! Are you connected to the internet?.",type:"error"}]})}});